import React, { useState, useContext } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { UserContext } from '../context/UserContext';
import './Navbar.css';
import logo from '../assets/images/logoNormal.png';
import Swal from 'sweetalert2';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isUserDropdownOpen, setIsUserDropdownOpen] = useState(false);
  const [isCartOpen, setIsCartOpen] = useState(false);

  const navigate = useNavigate();
  const { user, setUser } = useContext(UserContext);

  const handleLogout = () => {
    setUser(null);
    setIsUserDropdownOpen(false);
    Swal.fire({
      icon: 'info',
      title: 'Sesión cerrada',
      text: 'Has cerrado sesión correctamente.',
      confirmButtonColor: '#3085d6',
      confirmButtonText: 'Entendido'
    }).then(() => {
      navigate('/', { state: { loggedOut: true } });
    });
  };

  const getInitials = (user) => {
    if (!user) return '';
    const first = user.firstName ? user.firstName[0].toUpperCase() : '';
    const last = user.lastName ? user.lastName[0].toUpperCase() : '';
    return first + last;
  };

  return (
    <nav className="navbar">
      <div className="container navbar-container">
        <div className="navbar-logo">
          <Link to="/">
            <img src={logo} alt="El Taller del Maestro" />
          </Link>
        </div>

        <div className={`navbar-menu ${isMenuOpen ? 'active' : ''}`}>
          <ul className="navbar-links">
            <li><Link to="/">Inicio</Link></li>
            <li><Link to="/catalogo">Catálogo</Link></li>
            <li><Link to="/quienes-somos">Quiénes Somos</Link></li>
            <li><Link to="/contacto">Contáctenos</Link></li>
          </ul>
        </div>

        <div className="navbar-actions">
          <div className="cart-icon">
            <button onClick={() => setIsCartOpen(!isCartOpen)}>
              <i className="fas fa-shopping-cart"></i>
              <span className="cart-count">0</span>
            </button>
            {isCartOpen && (
              <div className="cart-dropdown">
                <div className="cart-empty">
                  <p>Tu carrito está vacío</p>
                  <Link to="/catalogo" className="btn btn-primary">Ir a comprar</Link>
                </div>
              </div>
            )}
          </div>

          <div className="user-icon">
            <button onClick={() => setIsUserDropdownOpen(!isUserDropdownOpen)}>
              {user ? (
                <span className="user-initials">{getInitials(user)}</span>
              ) : (
                <i className="fas fa-user"></i>
              )}
            </button>
            {isUserDropdownOpen && (
              <div className="user-dropdown-content">
                {user ? (
                  <>
                    <div className="user-profile-info">
                      <span className="user-initials-circle">{getInitials(user)}</span>
                      <div className="user-profile-details">
                        <div className="user-profile-name">{user.firstName} {user.lastName}</div>
                        <div className="user-profile-email">{user.email}</div>
                      </div>
                    </div>
                    <ul className="user-dropdown-list">
                      <li><Link to="/historial-compras" onClick={()=>setIsUserDropdownOpen(false)}>Historial</Link></li>
                      <li><Link to="/terms" onClick={()=>setIsUserDropdownOpen(false)}>Términos y Condiciones</Link></li>
                      <li><button className="logout-btn" onClick={handleLogout}>Cerrar Sesión</button></li>
                    </ul>
                  </>
                ) : (
                  <ul className="user-dropdown-list">
                    <li><Link to="/login" onClick={()=>setIsUserDropdownOpen(false)}>Iniciar Sesión</Link></li>
                    <li><Link to="/registro" onClick={()=>setIsUserDropdownOpen(false)}>Registrarse</Link></li>
                  </ul>
                )}
              </div>
            )}
          </div>
        </div>

        <div className="mobile-toggle">
          <button onClick={() => setIsMenuOpen(!isMenuOpen)}>
            <i className={isMenuOpen ? "fas fa-times" : "fas fa-bars"}></i>
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
